import React from 'react';
import './heroStyle.css';

export default function Hero({ id, title, link }) {  // Destructure the props here
  return (
    <div className='hero'>
      <div className='image-sec'>
        <img alt={title} src={link} /> {/* Use the title as the alt text for better accessibility */}
      </div>
      <h1>{title}</h1>
    </div>
  );
}
